var myApp=angular.module("myApp",[]);myApp.controller("WelcomeController",["$scope","$http",function(a,b){a.note={},a.notes=[],a.heading="Here is your message: ",a.getData=function(){b.get("/data").then(function(b){console.log(b),a.notes=b.data})},a.updateMessage=function(c){b.post("/data",c).then(a.getData())}}]);